package com.example.entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Entity@Table(name = "comment_like")@Data@NoArgsConstructor@AllArgsConstructorpublic class CommentLikeEntity extends BaseStringEntity {    @Column(name = "profile_id")    private Long profileId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "profile_id",            nullable = false,            insertable = false, updatable = false)    private ProfileEntity profileEntity;    @Column(name = "comment_id")    private String commentId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "comment_id",            nullable = false,            insertable = false, updatable = false)    private CommentEntity commentEntity;    @Enumerated(EnumType.STRING)    private Status status;    public enum Status {        LIKE, DIS_LIKE    }}